float conv_results[128][121];
float mp_results[128][60];
float inputs[2][128];
float fc_results[1408];

// implementation of neural network
unsigned int maia(float scaled_sample[NUM_SAMPLES][2]){

	unsigned int i, j, final_res;
	for (i = 0 ; i < 2; i++){
		for (j = 0; j < NUM_SAMPLES; j++){
			inputs[i][j] = scaled_sample[j][i];
		}
	}
	// conv+relu 1
	conv(1, NUM_SAMPLES, 2);
	// maxpool
	maxpool(121, 32);
	// conv+relu 2
	conv(3, 60, 128);
	// maxpool
	maxpool(45, 16);
	// flatten
	flatten(16, 22);
	fully_connected(8, 352);
	fully_connected(9, 64);
	fully_connected(10, 32);
	final_res = argmax(10);
#ifdef ISDEBUG
printf("Finish Stage 11\r\n");
#endif
	return final_res;
}

unsigned int argmax(unsigned int num_classes){
	unsigned int res = 0, i;
	float h;
	float prob = 0;
	for (i = 0 ; i < num_classes; i++){
		h = fc_results[i];
#ifdef ISDEBUG_ARGMAX
	printf("Class %d: %f\r\n", i, h);
#endif
		if (i == 0){
			prob =  h;
			res = i;
		}else{
			if (h > prob){
				res = i;
				prob = h;
			}
		}
	}
	return res;
}

void maxpool(unsigned int input_width, unsigned int input_height){
	unsigned i, j;
	// maxpooling effectively reduces the number of columns in the matrix, hence
	// we need to calculate the correct output_width

#ifdef ISDEBUG_MP
	printf("Output width is: %d\r\n", output_width);
#endif

	for (i = 0 ; i < input_height; i++){
#ifdef ISDEBUG_MP
	printf(" i: %d / %d \r\n", i, input_height);
#endif
		for (j = 0; j < input_width; j+=2){


			if (conv_results[i][j]-conv_results[i][j+1] > 0){
				mp_results[i][j/2] = conv_results[i][j];
			}else{
				mp_results[i][j/2] = conv_results[i][j+1];
			}

#ifdef ISDEBUG_ACCURACY

			if (i == 1 && j < 6 && input_width != 121){
				printf("STAGE 4: conv[%d][%d]: %f\r\n", i, j/2, mp_results[i][j/2]);
			}
#endif
		}
	}
}

void conv(unsigned int stage, int input_width, unsigned int input_height){
	unsigned int output_width, output_height, input_feat_map, window_size;
	unsigned int i, j, k, m;
	float h;
	// choose the multiplier values
#ifdef ISDEBUG_CONV
	printf("Selecting stage metadata\r\n");
#endif
	switch(stage){
		case 1:
			output_width = 121;
			input_feat_map = 2;
			output_height = 32; // number of filters
			window_size = 8;
			break;
		case 3:
			output_width = 45;
			input_feat_map = 32;
			output_height = 16;	// number of filters
			window_size = 16;
			break;
		default:
			return;
	}
	// allocate memory for output
#ifdef ISDEBUG_CONV
	printf("Initializing result to zeros\r\n");
#endif
	for (i = 0 ; i < output_height; i++){
		for (j = 0 ; j < output_width; j++){
			conv_results[i][j] = 0;
		}
	}
	for (i = 0 ; i < output_height; i++){		// number of filters
#ifdef ISDEBUG_CONV
	printf("i: %d / %d\r\n", i, output_height);
#endif
		for (j = 0 ; j < output_width; j++){	// number of columns

#ifdef ISDEBUG_CONV
	printf("j: %d / %d\r\n", j, output_width);
#endif
			for (m = 0 ; m < input_feat_map; m++){
				for (k = 0 ; k < window_size; k++){
					switch(stage){
						case 1:
							// i = 0-31, j = 0-121, k = 0-7, m = 0-1
							h = LAYER1[i][m][k];
							conv_results[i][j] += inputs[m][j+k] * h;

							break;
						case 3:
							h = LAYER3[i][m][k];
							// i = 0-15, m = 0-31, k = 0-16
							conv_results[i][j] += mp_results[m][j+k] * h;

							break;
					}
				}
			}

			conv_results[i][j] = conv_results[i][j] > 0 ? conv_results[i][j] : 0;	// RELU
#ifdef ISDEBUG_ACCURACY
			if (stage == 1 && i == 0 && j < 3){
				printf("STAGE %d: conv[%d][%d]: %f\r\n", stage, i, j, conv_results[i][j]);
			}
			if (stage == 3 && i == 1 && j < 3){
				printf("STAGE %d: conv[%d][%d]: %f\r\n", stage, i, j, conv_results[i][j]);
			}
#endif
		}
	}
	return;

}

void fully_connected(unsigned int stage, unsigned int input_size){

	unsigned int output_size;
	unsigned int i, j;
	float fc_results_temp[352];
	float h, b;
	// choose the multiplier values
	switch(stage){
		case 7:
			output_size = 128;
			break;
		case 8:
			output_size= 64;
			break;
		case 9:
			output_size = 32;
			break;
		case 10:
			output_size = 10;
			break;
		default:
			return;
	}
	for (i = 0 ; i < input_size; i++){
		fc_results_temp[i] =  fc_results[i];
		fc_results[i] = 0;
	}

	// fully connected layer operation
	for (i = 0  ; i < output_size; i++){
		switch(stage){
			case 8:
				b = LAYER7_BIAS[i];
				break;
			case 9:
				b = LAYER8_BIAS[i];
				break;
			case 10:
				b = LAYER9_BIAS[i];
				break;
			default:
				return;
		}
		for (j = 0 ; j < input_size; j++){
			switch(stage){
				case 8:
					h = LAYER7[j][i];
					break;
				case 9:
					h = LAYER8[j][i];
					break;
				case 10:
					h = LAYER9[j][i];
					break;
				default:
					return;
			}

			fc_results[i] += fc_results_temp[j]*h;
		}
		fc_results[i] += b;
		fc_results[i] = fc_results[i] > 0 ? fc_results[i] : 0;	// RELU
	}
}

// performs the flattening operation
void flatten(unsigned int num_rows, unsigned int num_cols){
	unsigned int i, j, counter;
	counter = 0;
	for (j = 0; j < num_cols; j++){
		for (i = 0 ; i < num_rows; i++){
			fc_results[counter] = mp_results[i][j];
			counter++;

		}
	}

#ifdef ISDEBUG_ACCURACY
	for (i =0  ; i < 10 ;i++){
		printf("FLATTEN: %d: %f\r\n", i, fc_results[i]);
	}
#endif
}
